import React, { Component, Fragment} from 'react'
import dolphin from '../../assets/images/team/team-dolphin.png'
import fe_logo from '../../assets/images/team/front-end-logo.png'
import web_design_logo from '../../assets/images/team/web-design.png'
import infra_logo from '../../assets/images/team/infra.png'
import game_design_logo from '../../assets/images/team/game-design.png'
import game_dev_logo from '../../assets/images/team/game-dev.png'
import styled , {keyframes} from 'styled-components'
import 'bootstrap/dist/css/bootstrap.min.css'

const theme = {
    frontEnd : {
        primaryColor : "#B9E6E9",
        shadow: "#31CBED"
    },
    webDesign : {
        primaryColor : "#E8BEC6",
        shadow : "#DB6CBE"
    },
    infrastructure : {
        primaryColor : "#A8E9A1",
        shadow : "#93EB98"
    },
    gameDesign : {
        primaryColor : "#FFED8C",
        shadow : "#FFEE7C"
    },
    gameDev : {
        primaryColor : "#FFAC3A",
        shadow : "#FFA700"
    }

}

const wipWupAnimation = (shadow) => keyframes`
    0% { box-shadow :  0px 0px 17px 1px ${shadow}; }
    50% { box-shadow :  0px 0px 26px 1px ${shadow}; }
    100%{ box-shadow :  0px 0px 17px 1px ${shadow}; }
`
const Button = styled.div`
    color : ${props => props.isActive ? "black" : props.color};
    cursor : pointer;
    font-size : ${props => props.fontSize};
    border : 2px solid ${props => props.color};
    padding : 10px;
    text-align : center;
    margin : 20px 0 0 0;
    font-family : "Itim-Regular";
    border-radius : 9px;
    margin : 20px auto;
    width : ${props => props.width};
    background-color : ${props => props.isActive ? props.color : "none"};
    transition : .6s ease;
    :hover {
        color : black;
        background-color : ${props => props.color};
        box-shadow :  0px 0px 15px 1px ${props => props.shadow};
    }
    animation : ${props => props.isActive? wipWupAnimation(props.shadow) : "none"} 3s ease-in-out infinite ;
    @media (min-width : 360px){
       display : none; 
    }
    @media (min-width : 1200px){
        display : block;
    }
    @media (min-width : 1800px){
        width : 150px;
    }
`
const Container = styled.div`
    background-color :  #023058;  
    /* background: linear-gradient(135deg, #00103a 0%, #023058 100%); */
    color : white;
    font-family : "Rye-Regular";
    padding-top : 40px;
    @media (min-width : 600px){
        height : auto;
    }
    @media (min-width : 1200px){
        height : 120vh;
        padding-top : 20px;
    }
    @media (min-width : 1400px){
        min-height : 120vh;
        padding-top : 30px;
    }
    @media (min-width : 1900px){
        min-height : 110vh;
        padding-top : 80px;
    }
    .animationFadeIn{
        animation: fadeInMobile .6s ease-in;   
        @media (min-width : 1200px){
            animation: fadeIn .6s ease-in;   
        }        
    }
    @keyframes fadeInMobile{
        0% { opacity : 0; }
        20% { opacity : 0; }
        100% { opacity: 1; }
    }
    @keyframes fadeIn{
        0% { opacity : 0; margin-left: 50px; }
        20% { opacity : 0; }
        100% { opacity: 1; }
    }
`
const SubjectItemContainer = styled.div`
    @media (min-width : 1200px){
        width : 110%;
    }
 `
const SubjectItem = styled.div`
    display : flex;
    flex-direction : column;
    padding : 0 !important;
    div {
        transition : all .6s ease-in-out;
        box-shadow :  0px 0px 0px 0px ${props => props.shadow};
    }
    :hover div {
        color : black;
        background-color : ${props => props.color};
        box-shadow :  0px 0px 15px 1px ${props => props.shadow};
    }
    @media (min-width : 360px){
        margin : 0 5px;
        justify-items : center;
    }
    @media (min-width : 1200px){
        margin : 10px 10px;   
    }
`
const SubjectLogo = styled.div`
    background-image : url(${props => props.src});
    background-repeat : no-repeat;
    background-size : cover; 
    background-position : center;
    border-radius : 50%;
    margin : 0 auto;
    cursor : pointer;
    transition : all .6s ease-in-out;
    animation : ${props => props.isActive? wipWupAnimation(props.shadow) : "none"} 3s ease-in-out infinite;
    @media (min-width : 360px){
        width : 12vw;
        height : 12vw;
    }
    @media (min-width : 768px){
        width : 10vw;
        height : 10vw;
    }
    @media (min-width : 1024px){
        width : 8vw;
        height : 8vw;
    }
    @media (min-width : 1200px){
        width : 89px;
        height : 89px;
    }
    @media (min-width : 1600px){
        width : 99px;
        height : 99px;
    }
    @media (min-width : 1800px){
        width : 120px;
        height : 120px;
    }
`
const OtherSubject = styled.h4`
    font-size: 32px;
    font-family : "Itim-Regular";
    display : block;
    @media (max-width : 1200px){
        display : none;
    }
`
const Header = styled.h1`
    color : white;
    @media (min-width : 360px){
        font-size : 40px;
        text-align : center;
        display : none;
    }
    @media (min-width : 600px){
        font-size : 50px;
    }
    @media (min-width : 768px){
        font-size : 96px;
    }
    @media (min-width : 1200px){
        text-align : left;
        font-size : 110px;
        display : block;
    }
` 
const SubHeader = styled.h2`
    color : white;
    @media (min-width : 360px){
